import React, { Component } from "react";
import { FaAlignLeft, FaAlignRight } from 'react-icons/fa';
import "./Navbar.css";

export default class Navbar extends Component {

  constructor() {
    super()
    this.navLinks = React.createRef();
  }

  menuAnimation = () => {
    this.navLinks.current.classList.toggle("open");
  }

  render() {
    const li = [
      {
        link: "/",
        text:"HOME"
      },
      {
        link: "/our_team/",
        text:"OUR TEAM"
      },
      {
        link: "/join_us/",
        text:"JOIN US!"
      },
      {
        link: "/contact/",
        text:"CONTACT"
      }
    ];

    return (
      <nav>
        <div className="menu" onClick={this.menuAnimation}>
          <FaAlignLeft/>
        </div>
        <div className = "Title">BECOMING<br/>BUSINESSWOMEN</div>
        <ul className="nav-links" ref={this.navLinks}>
          <li onClick={this.menuAnimation}>HOME</li>
          <li onClick={this.menuAnimation}>OUR TEAM</li>
          <li onClick={this.menuAnimation}>JOIN US!</li>
          <li onClick={this.menuAnimation}>CONTACT</li>
        </ul>
      </nav>
    );
  }
}
